import './App.css';
import Main from './pages/main';
import { Route,Routes} from 'react-router-dom';
import Login from './pages/login';
import SignUp from './pages/signup'
import Profile from './pages/profile';
import Update from './pages/update';
import Product from './pages/product';
import { BrowserRouter } from 'react-router-dom';
import { Provider, useDispatch, useSelector } from 'react-redux';
import store from './store';
import Header from './section/header';
import { useEffect } from 'react';
import { Navigate, useNavigate } from 'react-router';
import { setDataUser } from './store/actions/user';



function App() {

  const token = localStorage.getItem('token')

  return (
    <>
        <Header/>
        <Routes>
          <Route exact path='/' element={token?<Main/>:<Navigate to='/login'/>} />
          <Route path='/login' element={<Login/>} />
          <Route path='/signup' element={<SignUp/>}/>
          <Route path='/profile' element={token?<Profile/>:<Navigate to='/login'/>}/>
          <Route path='/profile/update' element={token?<Update/>:<Navigate to='/login'/>}/>
          <Route path='/product' element={token?<Product/>:<Navigate to='/login'/>}/>
        </Routes> 
    </>

  );
}

export default App;
